import numpy as np
from difflib import SequenceMatcher
import matplotlib.pyplot as plt
def task_func(s_list, plot_path=None):
    if not isinstance(s_list, list) or not all(isinstance(s, str) for s in s_list):
        raise ValueError("s_list must be a list of strings")
    if len(s_list) <= 1:
        return np.nan
    scores = []
    for i, s in enumerate(s_list):
        total = 0
        count = 0
        for j, other in enumerate(s_list):
            if i != j:
                ratio = SequenceMatcher(None, s, other).ratio()
                total += ratio
                count += 1
        avg_score = total / count
        scores.append(avg_score)
    if plot_path:
        plt.plot(scores)
        plt.savefig(plot_path)
    return scores

