def task_func(image_path='image.jpg', threshold=128):
    if not os.path.exists(image_path):
        raise FileNotFoundError(f"The image file {image_path} does not exist.")
    if not isinstance(threshold, int) or not (0 <= threshold <= 255):
        raise ValueError("Threshold must be an integer in the range 0-255.")
    img = cv2.imread(image_path)
    if img is None:
        raise FileNotFoundError(f"The image file {image_path} does not exist.")
    gray = cv2.cvtColor(img, cv2.COLOR_BGR2GRAY)
    _, binary = cv2.threshold(gray, threshold, 255, cv2.THRESH_BINARY)
    cv2.imwrite('binary_image.jpg', binary)
    return (gray, binary)

def task_func(pattern, log_dir='/var/log/'):
    matches = []
    for filename in os.listdir(log_dir):
        file_path = os.path.join(log_dir, filename)
        if os.path.isfile(file_path) and re.match(pattern, filename):
            matches.append((file_path, os.path.getmtime(file_path)))
    if not matches:
        return None
    return max(matches, key=lambda x: x[1])[0]

