def task_func(date_str, from_tz, to_tz):
    date = parse(date_str).replace(tzinfo=pytz.timezone(from_tz))
    date = date.astimezone(pytz.timezone(to_tz))
    year = date.year
    idx = np.where(MOON_PHASES_YEARS == year)[0]
    if idx.size == 0:
        idx = np.searchsorted(MOON_PHASES_YEARS, year, side='right') - 1
    if idx < 0:
        idx = 0
    elif idx >= len(MOON_PHASES_YEARS) - 1:
        idx = len(MOON_PHASES_YEARS) - 1
    cycle = (year - MOON_PHASES_YEARS[idx]) % 7
    days_in_cycle = 365.25 * 7
    days_since_ref = (date - datetime.datetime(MOON_PHASES_YEARS[idx], 1, 1, tzinfo=pytz.utc)).total_seconds() / 86400
    phase = (days_since_ref / days_in_cycle) % 1
    return float(phase)

